export default function Hoodies() {
  function addtoCart() {
    const pricing = 0;
    const x = document.querySelector(".addhoodie");
    x.addEventListener("click", () => {
      pricing += 50;
    });
  }

  return (
    <div className="container">
      <h1>Hoodies</h1>
      <button onClick={addtoCart} className="addhoodie">
        50
      </button>
    </div>
  );
}
